ISLAMABAD, Jan 1 (APP):Member National Assembly (MNA) from Pakistan Muslim League (Q) Moonis Elahi called on Prime Minister (PM) Imran Khan here at PM House on Wednesday.
The meeting was also joined by Minister for Water Resources Muhammad Faisal Vawda, the PM office media cell said.
